// frontend/src/OutraPagina.js

import React from 'react';

function OutraPagina() {
  return (
    <div>
      <h1>Outra Página</h1>
      <p>Conteúdo da outra página...</p>
      <p>Nome: Leonardo</p>
    </div>
  );
}

export default OutraPagina;
